@Override
public void run() {
  RequestParams p = core.getSolrConfig().getRequestParams();
  RequestParams.VersionedParams v = p.getParams("watched");
  if(v== null){
    watchedVal = null;
    version=-1;
    return;
  }
  if(v.getVersion() != version){
    watchedVal =  v.getMap().get("x");
  }
}

